  {"id": "tr_10058_tr098020", "count": 63, "text": "ወደኬንያ የ ኮበለሉ ት ሁለት አስር አለቃ ና አምስት ወታደሮች ናቸው ተ ባለ"},
  {"id": "tr_10059_tr098021", "count": 64, "text": "አንዳንዶችጋዜጠኞች ለ ኢትዮጵያውያ ን በ ውን አስቸጋሪ ሆነዋል"},
  {"id": "tr_1005_tr11006", "count": 65, "text": "የኤርትራውያን ቤት ነዋሪው ን ህብረተሰብ እያ ፋጀ ነው"},
  {"id": "tr_10060_tr098022", "count": 66, "text": "እኛእንደ ውም የኤርትራ መንግስት ም ምርኮኛ አድርጐ የ ያዛቸው ን ኢትዮጵያውያ ን ን እንዲ ለቅ እን ጠይቃ ለ ን ሲሉ ገልጿ ል"},
  {"id": "tr_10061_tr098023", "count": 67, "text": "ፕሮፌሰርአስራት ተሽ ሏቸው ከ ሆስፒታል ወጡ"},
  {"id": "tr_10062_tr098024", "count": 68, "text": "በደሴከተማ አስራ ስድስት ሱቆች ን ያቃጠ ለ ችው ኤርትራዊ ት ተያዘች"},
  {"id": "tr_10063_tr098025", "count": 69, "text": "ጣሊያንሄሊኮፍተሮች እንድታ ዋጣ ተ ጠየቀች"},
  {"id": "tr_10064_tr098026", "count": 70, "text": "ሻእቢያዜጐች ን ኢትዮጵያዊ እ ያሰኘ የ ፈጸመው ኢኮኖሚያዊ ምዝበራ ተጋለጠ"},
  {"id": "tr_10065_tr098027", "count": 71, "text": "ዶክተርበየነ ጴጥሮስ ገልጸዋል"},
  {"id": "tr_10066_tr098028", "count": 72, "text": "የኢንቨስትመንት አዋጁ ፖስታ ና ቴሌ ን ለ ባለ ሀብቶች መልቀቅ አለ በት"},
