  {"id": "tr_10068_tr098030", "count": 74, "text": "ይሁንእንጂ የዚህ ችን ሀገር ፖለቲካ ከሚያ ሾሩ ት ሰባት ሰዎች መካከል አንዱ ናቸው"},
