  {"id": "tr_10071_tr098033", "count": 78, "text": "በዚሁ ምክንያት ሻቢያ ከ ኢትዮጵያ የሚ ያገኘው ጥቅም ተቋርጦ በታል"},
  {"id": "tr_10072_tr098034", "count": 79, "text": "በኢትዮ ኬንያ ድንበር ሁለት መቶ ሰዎች ሞቱ"},
  {"id": "tr_10073_tr098035", "count": 80, "text": "ኢትዮጵያዊው በላይ ተክሉ ኢትኦጵ ን አሳ ሰሩ"},
  {"id": "tr_10074_tr098036", "count": 81, "text": "የአይዲድ ቀኝ እጅ ትናንት ተገደሉ"},
  {"id": "tr_10075_tr098037", "count": 82, "text": "አብደላእድሪስ ወደ ግብጽ እንዳይ ገቡ ታገዱ"},
  {"id": "tr_10076_tr098038", "count": 83, "text": "ጭረ ታቸውን እንደ ያዙ ወደማ ሳቸው ሄዱ"},
  {"id": "tr_10077_tr098039", "count": 84, "text": "ኢትዮጵያዊተመራማሪ የ ፕሪንስ ክሎስ ሽልማት ን አገኘ"},
  {"id": "tr_10078_tr098040", "count": 85, "text": "ሆቴልም እንደ ገባሁ ስማቸው ን አጠና ያደረግ ነውን ውይይት ም አስብ ነበር"},
  {"id": "tr_10079_tr098041", "count": 86, "text": "ግንችሎታው የ ሌላቸው ተጫዋቾች ም ችሎታቸው ሊ ዳብር ና ጥሩ ሊሆን እንደሚ ችል አይ ታወቅ ም"},
