  {"id": "tr_10087_tr098049", "count": 95, "text": "በእለቱ ጥቁር ማሊያ አድርገው የ ገቡት ዩናይት ዶች ልክ እንደ ማሊያው ጠቁ ረው ነበር የ ወጡት"},
  {"id": "tr_10088_tr098050", "count": 96, "text": "ከየክልሉ ጥሩ ጥሩ ተጨዋቾች ናቸው ብለው ያመኑ ባቸውን አሰባ ስበዋል"},
