  {"id": "tr_10105_tr098067", "count": 116, "text": "የተባረሩኤርትራውያን ድርጅታቸው ተ ሸጦ ወኪሎ ቻቸው ከ አገር እንዲ ወጡ ተወሰነ"},
  {"id": "tr_10106_tr098068", "count": 117, "text": "ወዲያው ከ ታላቅ ወንድማቸው ከ ስዬ ጋር ማውራት ጀመሩ"},
  {"id": "tr_10107_tr098069", "count": 118, "text": "ከሄጉ የ ድንበር ኮሚሽን ውሳኔ በኋላ የ ኢትዮጵያ ባለስልጣናት ስራ በዝቶ ባቸው መሰንበቱ ን ቅርበት ያ ላቸው ምንጮች ገለጹ"},
  {"id": "tr_10108_tr098070", "count": 119, "text": "የኢትዮጵያ ፕራይቬታይዜሽ ን ኤጀንሲ ባለፈው ሳምንት የመንግስት የ ልማት ተቋማትን ለ ሽያጭ አቀረ በ"},
  {"id": "tr_10109_tr098071", "count": 120, "text": "አሜሪካየምት ደግፈው ኢትዮጵያ ን ነው ብለዋል"},
  {"id": "tr_1010_tr11011", "count": 121, "text": "ኢትዮጵያበ ሱዳን ያላ ት ዲፕሎማሲ ያዊ ውክልና አ ወደ አምባሳደር ደረጃ እንዲ ያድግ መጠየቋ ን የ ኢትዮጵያ የውጭ ጉዳይ ሚኒስቴር ባለፈው አርብ አስ ታወቀ"},
  {"id": "tr_10110_tr098072", "count": 122, "text": "ዛሬነገሩ ሁሉ ተገለባብ ጧል"},
  {"id": "tr_10111_tr098073", "count": 123, "text": "እንደረፋድ ገበያ የተ ሟሟቀ ነው"},
  {"id": "tr_10112_tr098074", "count": 124, "text": "እንደኔው የመጣ አንድ ኢትዮጵያዊ አገኘሁ"},
  {"id": "tr_10113_tr098075", "count": 125, "text": "ተፈናቃዮችን ማስተናገዱ ና ለ አዲሱ ኑሮ አቸው ማዘጋጀቱ ለ ሻእቢያ ተጨማሪ የ ቤት ስራ ብቻ ሳይሆን ተጨማሪ የ ራስ ምታት ም ነው"},
  {"id": "tr_10114_tr098076", "count": 126, "text": "አጼዮሀንስ ለእንግሊዟ ንግስት የ ጻፉት ደብዳቤ ከ ሌሎቹ ለ የ ት ያለ ነበር"},
  {"id": "tr_10115_tr098077", "count": 127, "text": "በዚህስያሜ ማናችን ም ባን ደሰት ም ካለ ው ሀቅ አንጻር ደግሞ የተገባ እርምጃ ነው"},
  {"id": "tr_10116_tr098078", "count": 128, "text": "የራዲዮ የ ስርጭት ሰአት እንዲ ራዘም ና አዳዲስ ፕሮግራሞች ም እንዲ ከፈቱ ተደርጓል"},
  {"id": "tr_10117_tr098079", "count": 129, "text": "የወናጐ ተፈናቃዮች ንም እንደ ሌሎቹ ቃኝ ቻለሁ"},
  {"id": "tr_10118_tr098080", "count": 130, "text": "ኢሳይያስአፈወርቂ ኢትዮጵያ ና ኢትዮጵያ ም ያሳደገ ቻቸው መሆናቸው እውነት ነው"},
  {"id": "tr_10119_tr098081", "count": 131, "text": "ጸረኢትዮጵያ ና ጸረ አንድነት ቡድኖች ይህን ሊ ገነዘቡ ት ይገባል"},
  {"id": "tr_1011_tr11012", "count": 132, "text": "የሄዱት አንዴ ሄደ ዋል ጠፍ ተዋል ሞ ተዋል"},
  {"id": "tr_10120_tr098082", "count": 133, "text": "በብዙ ሺዎች የሚ ቆጠሩት ከ አገር ተሰደዱ"},
  {"id": "tr_10121_tr098083", "count": 134, "text": "እንደሩሲያ ቻይና ሩማንያ ቡልጋሪያ ና ዩክሬን ያሉ አገሮች ለ ሁለቱ ም ወገኖች የ ጦር መሳሪያ አቅርበ ዋል"},
  {"id": "tr_10122_tr098084", "count": 135, "text": "የተባለውን የሚያደርገው ም በዚህ ምክንያት ነው"},
  {"id": "tr_10123_tr098085", "count": 136, "text": "ሸክላሰሪዋ አ ለሚ ቱ በ ጉልቻ ስራዋ የታወቀች ነች"},
  {"id": "tr_10124_tr098086", "count": 137, "text": "አብዱአስፋልቱ ላይ የ ኰለኰ ለ ው ድንጋይ መኪና አላ ሳልፍ አለ"},
  {"id": "tr_10125_tr098087", "count": 138, "text": "ጠጁን ኰ መኰ መ ኰ መኰ መ ና ሚስቱ ን ሲ ያሰቃ ያት አደረ"},
  {"id": "tr_10126_tr098088", "count": 139, "text": "ድንቹበ ደንብ ስለተኰተኰተ በ ጥሩ ሁኔታ ኰረተ"},
  {"id": "tr_10127_tr098089", "count": 140, "text": "በድህነቱ ላይ ይህ ክፉ በሽታ ስለ ያዘው ሰውነቱ በጣም ኰ ሰሰ"},
  {"id": "tr_10128_tr098090", "count": 141, "text": "በለጠች የ በየነ የ በኩር ልጅ ነች"},
  {"id": "tr_10129_tr098091", "count": 142, "text": "የቆላ ቁስል ና ቁርጥ ማት በጣም አሰቃቂ በሽታዎች ናቸው"},
  {"id": "tr_1012_tr11013", "count": 143, "text": "ለትምህርት ና ጥናቶች የ ተቀረጹ ባቸው የ ቪዲዮ ክሮች የ ካሴት ክሮች ዲ ስኬቶች ና የ ትምህርት መጻህፍት በ መመሪያ ለ ያለ ብዛት ገደብ በ ሙሉ እንዲ ገቡ ከተ ፈቀዱ ት ውስጥ የሚጠቀሱ ናቸው"},
