  {"id": "tr_10133_tr098095", "count": 147, "text": "ጣትሽን አን ቋ ቂው ም አታንቋቂ ውም ማ ንም አላ የ ሽም"},
  {"id": "tr_10134_tr098096", "count": 148, "text": "በጣምስለሚ ወደው የ መኮንን ወንድም መኮንን ን መኳ ነው የሚለው"},
