  {"id": "tr_10164_tr099006", "count": 181, "text": "እስካሁንያለው የ ደብሩ ክህነት ና የ አካባቢው ምእመናን ጥንካሬ ና አቋም ግን ተደ ን ቋል"},
  {"id": "tr_10165_tr099007", "count": 182, "text": "እንደገና ደግሞ በ ዚያው ሰሞን የሚ ያርሱ በት ከ ብት አጥተው ብዙዎች በ ረሀብ አ ለቁ የ ተቀሩት ም ይ ሰደዱ ጀመር"},
  {"id": "tr_10166_tr099008", "count": 183, "text": "ጥቁርውሀ ን ተሻግ ረን አዋሳ ስን ገባ ለ ፖሊሶቹ የ እንኳ ን ደህ ና መጣችሁ አቀባበል ተደረገላቸው"},
  {"id": "tr_10167_tr099009", "count": 184, "text": "ዶክተርሪያክ ማቻር የ ሱዳን ን መንግስት ትእዛዝ መቃወማቸው ተገለጠ"},
  {"id": "tr_10168_tr099010", "count": 185, "text": "ሩስያየ ኢትዮጵያ ን እዳ ስረዛ በ መሰረተ ሀሳብ ተስማማች"},
