  {"id": "tr_1016_tr11017", "count": 187, "text": "የጄኔራል ነት ማእረግ ያ ላቸው ከፍተኛ ወታደራዊ መኮንኖች ጠቅላይ ሚኒስትር መለስ ዜናዊ የሚመሩ ትን ስብሰባ መጀመራቸው ን ምንጮቻችን ገለጹ"},
