  {"id": "tr_10171_tr099013", "count": 189, "text": "ባለሙያዎቹበ ተጨማሪ ም እነዚህ ዲ ቃሎች የ ኢኮሎጂ መዛባት ሊያ ስከትሉ እንደሚ ችሉ ም አክለው ገልጸዋል"},
