  {"id": "tr_10206_tr099048", "count": 228, "text": "እንኳን ለ ሴቶቹ ለ ወንዶቹ ም ይከብዳ ል"},
  {"id": "tr_10207_tr099049", "count": 229, "text": "የሊቨርፑ ሉ ሮቢ ፎውለር ለ ዋናው ቡድን ተሰልፎ ተጫው ቷል"},
  {"id": "tr_10208_tr099050", "count": 230, "text": "ይህምሆኖ ባቡር ጥሩ የ ኳስ ችሎታ ያ ላቸው ወጣት ተጨዋቾች ን አሰባ ስቧል"},
