  {"id": "tr_1020_tr11021", "count": 232, "text": "ከዚህበ ተጨማሪ የ ኢትዮጵያ መንግስት ተቃዋሚዎች ን ለ መርዳት ሰራዊቷ ን ወደ ሱማሌ ም በ መላክ በ ቅድሚያ የ ያዘችው ኤርትራ ና ት"},
  {"id": "tr_10210_tr099052", "count": 233, "text": "ሀያአንዱ ብሄራዊ ፌዴሬሽኖች የ አመቱ ን ሂሳ ባቸውን ኦዲት የ ሚያደርጉት በ ስፖርት ኮሚሽኑ ተቀጣሪ የ ውስጥ ኦዲተሮች ነው"},
