  {"id": "tr_10212_tr099054", "count": 235, "text": "አሰልጣኙካርሎስ ቢያ ን ኪ ም ዋናው ተጠሪ ናቸው"},
  {"id": "tr_10213_tr099055", "count": 236, "text": "ኢትዮጵያሰራዊቷ ን በ ሶማሊያ አንጃዎች ጐዴ ውስጥ አሰልጥ ናለች ይላሉ"},
