  {"id": "tr_1594_tr16095", "count": 1534, "text": "ባለፈውአመት ከ አገር ውጭ እንደ ነበሩ ና በውጭ የሚኖሩ ኢትዮጵያውያ ን ን እንዳነጋገሩ ለማወቅ ች ለናል"},
  {"id": "tr_1595_tr16096", "count": 1535, "text": "የኢትዮጵያ መንግስት ግን የ አሜሪካን ን መንግስት ፍርሀት ና ስጋት ጨርሶ እንደማይ ቀበለው አስረድ ቷል"},
  {"id": "tr_1596_tr16097", "count": 1536, "text": "ይህጉዳይ የ እያንዳንዱ ን የ ትግራይ ኗሪ ቤት ስለሚያ ንኳኳ የበለጠ ንትርክ ያስከትላል ተብሎ ይገመ ታል"},
  {"id": "tr_1597_tr16098", "count": 1537, "text": "አማራነኝ ካል ክ ኢትዮጵያዊ ልት ሆን አት ችልም"},
  {"id": "tr_1598_tr16099", "count": 1538, "text": "በቫይታሚ ኑ አርባ ያህል ከ ቫይረሱ ጋር የሚኖሩ ወገኖች ለ ስድስት ወራት ሊጠቀሙ በት እንደሚ ችሉ ም ዳይሬክተሩ ገልጸዋል"},
  {"id": "tr_1599_tr16100", "count": 1539, "text": "ሀያክለቦች እስካሁን እያንዳንዳቸው አስራ አምስተኛው ሳምንት ላይ ይገኛሉ"},
  {"id": "tr_159_tr02059", "count": 1540, "text": "አንደኛየ ጤና ና የ ተፈጥሮ ሳይንስ ተማሪዎች የሚ ገለገሉ ባቸው በተለይ ም የ ተፈጥሮ ሳይንስ ተማሪዎች ላቦራቶሪ ዎች ለ አንደኛ አመት ተማሪዎች ብቻ ሊ ያገለግሉ የሚችሉ ናቸው"},
  {"id": "tr_15_tr01015", "count": 1541, "text": "ኦስሪያንበ ሀገሩ አንድ ለ ዜሮ አሸንፎ ሶስት ነጥብ ይ ዟል"},
  {"id": "tr_1600_tr17001", "count": 1542, "text": "ሚኒኮምፒውተሮች በጣም ጥቂት ናቸው"},
  {"id": "tr_1601_tr17002", "count": 1543, "text": "የአውሮፓ ኮሚሽን ለ ምግብ ዋስትና ፕሮግራም ማስፈጸሚያ ሀያ አራት ሚሊዮን ዶላር አ ጸደቀ"},
  {"id": "tr_1602_tr17003", "count": 1544, "text": "ሰላሳሺህ ኢትዮጵያውያ ን የ ደረሱበት ጠፋ"},
  {"id": "tr_1603_tr17004", "count": 1545, "text": "ድመቶችና ውሾች አሳ ዎቹን ተ መገቡ ብላ ኢሰፓዋ ሚስቴ ነገረችኝ"},
  {"id": "tr_1604_tr17005", "count": 1546, "text": "ለዚህም ማረጋገጫ ችን ቅዱስ ጳውሎስ እንኳ ን ም ድ ራውያን ገዢዎች ን ይቅር ና በ መላእክት ላይ ስልጣን እንዳለ ን አታውቁም ን ብሎ ለ ቆሮንቶስ ምእመናን ጽፏል"},
  {"id": "tr_1605_tr17006", "count": 1547, "text": "የአቶ ኢሳያስ የ ደህንነት ሹም ከስራ ተወገዱ"},
  {"id": "tr_1606_tr17007", "count": 1548, "text": "ከተባረሩት ውስጥ በ ኤርትራ መንግስት ቀሳውስት ጭምር እንደሚገኙ በት ተ ገልጧል"},
