  {"id": "tr_160_tr02060", "count": 1552, "text": "የሻእቢያ መንግስት ከ ሀገሩ የሚያስ ወጣቸው የ ኢትዮጵያውያ ን አብዛኞቹ የተ ደበደቡ የተ ገረፉ የ ተዘረፉ ና በተለይ ም ሴቶቹ የ ተደፈሩ መሆናቸው ን ዘመን አስ ታውቋል"},
  {"id": "tr_1610_tr17011", "count": 1553, "text": "ጣሊያናዊሬኖ ሳሪ የ ኢትዮ ኤርትራ ግጭት ን እንዲ መለከቱ በ አውሮፓ ህብረት መመደ ባቸው ኢትዮጵያ ላይ መቀለድ ነው በ ማለት አንዳንድ ምንጮች ይገልጻሉ"},
