  {"id": "tr_1612_tr17013", "count": 1555, "text": "በፔዶ ፊ ሊያ የ ተጠረጠሩ ት የ ሰርከስ ኢትዮጵያ ዴ ሬክተር ራሳቸው ን ገደሉ"},
  {"id": "tr_1613_tr17014", "count": 1556, "text": "እንደሪፖርተሩ ዘገባ ጠቅላይ ሚኒስትር ስ መለስ ዜናዊ አሜሪካ በ ቀዩ ባቸው ቀናት ከ ኢትዮጵያውያ ን በኩል ከፍተኛ ተቃውሞ ደርሶ ባቸዋል"},
