  {"id": "tr_9920_tr097002", "count": 10785, "text": "ይህደግሞ ከ አንድ እውነተኛ ጠንካራ ኢትዮጵያዊ የሚጠበቅ ና የሚ ያኮራ አባባል ነው"},
  {"id": "tr_9921_tr097003", "count": 10786, "text": "ስማስማ ጆሮ ያለው ይስማ ይህ መልእክት ለ ኢትዮጵያ ህዝብ እንዲደርስ የ ኢትዮጵያ ሬዲዮ ና ቴሌቭዥን እንዲ ያስተላልፉ ጥሪ ተደርጓል"},
  {"id": "tr_9922_tr097004", "count": 10787, "text": "የተባበሩት መንግስታት ድርጅት ኮሚሽነር ኢትዮጵያ ኤርትራዊያን ን ከ ማባረር ት ታቀብ አለ"},
  {"id": "tr_9923_tr097005", "count": 10788, "text": "ኤርትራና ኢትዮጵያ በ ሱዳን ና በ አማጺያኑ መካከል ላ ስራ አምስት አመታት የ ተካሄደው ን ውጊያ ለ ማቆም ውይይት እንዲያደርግ ያዘጋጁት የ አ ጋድ አባል አገሮች ናቸው"},
  {"id": "tr_9924_tr097006", "count": 10789, "text": "ለዚህም ማስረጃ ሚስት ሲ ያገባ ለደ ገሰው ድግስ የ ጊ ዎን ሆቴሎች አስተዳደር ሀምሳ ፐርሰንት ቅናሽ እንዲያደርግ ለት አስገድዶ እንደ ነበር ሪፖርቱ ጠቁ ሟል"},
