  {"id": "tr_9926_tr097008", "count": 10791, "text": "እየተደረገያለውን ሁሉ ገልጬ ላቸው ስንብት ፈጸም ን"},
  {"id": "tr_9927_tr097009", "count": 10792, "text": "አጼምንሊክ ም የመጨረሻ ውን ደብዳቤ ለ ኮንት አንቶኔሊ ጻፈ ለት"},
