  {"id": "tr_9931_tr097013", "count": 10797, "text": "የኦሮ መ ያ ጠቅላይ ፍርድ ቤት ዳኛ ወደ ኬንያ ሲ ኮበልሉ ተያዙ"},
  {"id": "tr_9932_tr097014", "count": 10798, "text": "ዳኞችስ ላከናወ ኗቸው ስራዎች ሪፖርት እንዲ ያቀርቡ አስፈላጊው ን ማብራሪያ እንዲሰጡ ይጠ የ ቃሉ"},
  {"id": "tr_9933_tr097015", "count": 10799, "text": "ይህንየ ገለጸው ኮርፔክስ የ ደቡብ አፍሪካ ው ፕሮጀክት ኢንጂነሪንግ ኩባንያ ነው"},
